CREATE TABLE t_sys_config(
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    f_system_identifier_string CHAR(512) NOT NULL DEFAULT 'e12-cffc',
    f_location_string CHAR(512) NOT NULL,
    f_maintainer_email_string CHAR(512) NOT NULL DEFAULT 'sunrexmaintainer@flsenergy.com',
