    f_system_description TEXT NOT NULL,
    f_preferred_units_string CHAR(512),
    f_remote_server_string CHAR(512) NOT NULL DEFAULT 'http://my.flsenergy.com/api/log/v3json',
    f_daily_report_to_customer CHAR(1) NOT NULL DEFAULT 'F',
    f_averaged_report_interval_minutes INTEGER NOT NULL DEFAULT 5,
    f_snapconnect_licensed_address_str CHAR(512) NOT NULL DEFAULT '000020',
    f_synapse_bridge_port_string CHAR(512),
    f_flexio_port_string CHAR(512),
    f_erate0_analog_out_sensor_address CHAR(512),
    f_erate0_max_btu_per_hr DOUBLE NOT NULL DEFAULT 300000.0,
    f_erate1_analog_out_sensor_address CHAR(512),
    f_erate1_max_btu_per_hr DOUBLE NOT NULL DEFAULT 300000.0,
    is_active CHAR(1),
    created_on TIMESTAMP,
    modified_on TIMESTAMP,
    created_by INTEGER REFERENCES auth_user(id) ON DELETE CASCADE,
    modified_by INTEGER REFERENCES auth_user(id) ON DELETE CASCADE
);
